                  svg#freepik_stories-completed-steps.animated #freepik--Shadows--inject-3 {
                    animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) zoomIn;
                    animation-delay: 0s;
                  }
                  svg#freepik_stories-completed-steps.animated #freepik--plants-2--inject-3 {
                    animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) slideDown;
