                    animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) fadeIn;
                    animation-delay: 0s;
                  }
                  svg#freepik_stories-completed-steps.animated #freepik--Screen--inject-3 {
                    animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) zoomOut, 1.5s Infinite linear heartbeat;
                    animation-delay: 0s, 1s;
                  }
                  svg#freepik_stories-completed-steps.animated #freepik--Steps--inject-3 {
                    animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) slideUp;
                    animation-delay: 0s;
                  }
                  svg#freepik_stories-completed-steps.animated #freepik--plant-1--inject-3 {
                    animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) slideUp;
