                    animation-delay: 0s;
                  }
                  svg#freepik_stories-completed-steps.animated #freepik--speech-bubble--inject-3 {
                    animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) slideLeft, 1.5s Infinite linear heartbeat;
                    animation-delay: 0s, 1s;
                  }
                  @keyframes zoomIn {
                    0% {
                      opacity: 0;
                      transform: scale(0.5);
                    }
                    100% {
                      opacity: 1;
                      transform: scale(1);
                    }
                  }
                  @keyframes lightSpeedRight {
                    from {
                      transform: translate3d(50%, 0, 0) skewX(-20deg);
                      opacity: 0;
                    }
                    60% {
                      transform: skewX(10deg);
                      opacity: 1;
                    }
                    80% {
                      transform: skewX(-2deg);
                    }
                    to {
                      opacity: 1;
                      transform: translate3d(0, 0, 0);
                    }
                  }
                  @keyframes zoomOut {
                    0% {
                      opacity: 0;
                      transform: scale(1.5);
                    }
                    100% {
                      opacity: 1;
                      transform: scale(1);
                    }
                  }
                  @keyframes slideDown {
                    0% {
                      opacity: 0;
                      transform: translateY(-30px);
                    }
                    100% {
                      opacity: 1;
                      transform: translateY(0);
                    }
                  }
                  @keyframes fadeIn {
                    0% {
                      opacity: 0;
                    }
                    100% {
                      opacity: 1;
                    }
                  }
                  @keyframes heartbeat {
                    0% {
                      transform: scale(1);
                    }
                    10% {
                      transform: scale(1.1);
                    }
                    30% {
                      transform: scale(1);
                    }
                    40% {
                      transform: scale(1);
                    }
                    50% {
                      transform: scale(1.1);
                    }
                    60% {
                      transform: scale(1);
                    }
                    100% {
                      transform: scale(1);
                    }
                  }
                  @keyframes slideUp {
                    0% {
                      opacity: 0;
                      transform: translateY(30px);
                    }
                    100% {
                      opacity: 1;
                      transform: inherit;
                    }
                  }
                  @keyframes slideLeft {
                    0% {
                      opacity: 0;
                      transform: translateX(-30px);
                    }
                    100% {
                      opacity: 1;
                      transform: translateX(0);
                    }
                  }
